import logo from "./logo.svg";
import html from "./HTML5_logo.svg";
import "./App.css";
import  { MyButton } from "./MyButton";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <img src={html} className="App-logo" alt="logo" />
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <MyButton />
    </div>
  );
}

export default App;
